            </Breadcrumb>
            <div className="site-layout-content">Content</div>
            <style jsx>
                {
                    `.site-layout-content {
                        background: #fff;
                        padding: 24px;
                        min-height: 100%;
                      }`
                }
            </style>
        </Content>
    )
}

export default MyContent
